declare const collapsible: {
    backgroundColor: string;
    header: {
        content: {
            mr: number;
        };
        arrow: {
            center: {
                alignSelf: string;
            };
            start: {
                alignSelf: string;
            };
            end: {
                alignSelf: string;
            };
        };
    };
    content: {
        regular: {
            px: number;
            p: number;
            color: string;
        };
        stacked: {
            ml: number;
            pr: number;
            pt: number;
            p: number;
            color: string;
        };
    };
};
export default collapsible;
